So a couple weeks ago i hit 500 followers and wanted to celebrate with a post of most of the summer games I’ve picked up. Make sure to keep your eyes peeled for a giveaway that I’m planning, the game i want to giveaway is not out yet so I’m stuck in limbo lol.

Firstly i want to say thank you to everyone that has followed me, this little hobby has become a huge part of my life and i love it.

I would also like to thank everyone that i have become friends with and just communicate with, I’ve made tons of friends on here that i can’t ever thank enough. I also want to thank my super supportive girlfriend @breathofmajora i would not be where i am today without her, especially in my collecting.

Again thank you everyone!! Be sure to check out my awesome gaming buddies and friends!

